import styled from '@emotion/styled'
import React from 'react'
import FriendsListItems from './FriendsListItems'

const MainContainer = styled("div")({
    flexGrow: 1,
    width: "100%"
})

const DUMMY_FRIENDS_LIST = [ 
    {
        id: 1,
        username: "John",
        isOnline: true,
    },
    {
        id: 2,
        username: "Mary",
        isOnline: false,
    },
    {
        id: 3,
        username: "Anna",
        isOnline: true,
    }
]

function FriendsList({friends }) {
    return (
        <MainContainer>
{friends.map(( f )=>(
    <FriendsListItems
    username={f.username}
id={f.id}
isOnline={f.isOnline}
key={f.id}

     />


))}
        </MainContainer>
    )
}

export default FriendsList
